@DippysWorld @Nemtastic1 @fitcja @ScottAdamsSays @softcrush The risk is that these vaccines are leaky, they don't stop a big chunk of infections. It leaves the door open for a mutation to overcome the protection.

If it does before we develop stronger vaccines, it's a problem.

All things considered, worth the gamble. But it is a risk.

